// SPDX-License-Identifier: AGPL-3.0-only
pragma solidity 0.8.15;

contract SimpleTest {

    function add1(uint256 a, uint256 b) public pure returns (uint256) { // transaction cost:24739 gas
        if (a==0) {
            return 0;
        }

        uint256 c = a + b;
        return c;
    }

    function add2(uint256 a, uint256 b) public pure returns (uint256 c) { // transaction cost:24704 gas
        if (a==0) {
            return 0;
        }

        c = a + b;
        return c;
    }

    function add3(uint256 a, uint256 b) public pure returns (uint256) { // transaction cost:24670 gas
        if (a==0) {
            return 0;
        }

        return a + b;
    }
}

